class Solution(object):
    def repeatedSubstringPattern(self, s):
        """
        :type s: str
        :rtype: bool
        """
        length = len(s)
        dic = {}
        for item in s:
            if item in dic:
                dic[item] += 1
            else:
                dic[item] = 1
        valueList = dic.values()
        minValue = min(valueList)
        if minValue == 1:
            return False
        
        candidate = [minValue]
        import math
        for i in xrange(2,int(math.sqrt(minValue))+1):
            if minValue % i == 0:
                candidate.append(i)
                candidate.append(minValue/i)
                
        for item in candidate:
            tempLength = length/item
            if s[:tempLength] * item == s:
                return True
        return False
        
s = Solution()
